import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Button } from '@mui/material';
import logo from '../images/logo.svg'; // Adjust the path to where your logo.svg is located

const Navbar = () => {
  return (
    <AppBar
      position="static"
      style={{ backgroundColor: 'white', boxShadow: 'none' }} // White background and no shadow
    >
      <Toolbar>
        <img 
          src={logo} 
          alt="Logo" 
          style={{
            height: '150px', // Adjust height as needed
            flexGrow: 1,
            display: 'block'
          }}
        />
        <Button color="inherit" component={Link} to="/" style={{ color: '#333' }}>
          Home
        </Button>
        <Button color="inherit" component={Link} to="/services" style={{ color: '#333' }}>
          Services
        </Button>
        <Button color="inherit" component={Link} to="/contact" style={{ color: '#333' }}>
          Contact Us
        </Button>
        <Button color="inherit" component={Link} to="/location" style={{ color: '#333' }}>
          Location
        </Button>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
